import React, { Component, Fragment } from 'react'
export default class GioHang extends Component {
    state = {
        products: [],
        token: this.props.token
    };
    componentDidMount() {
        this.setState({ token: this.props.token })
        this.loadProducts();
    }
    loadProducts = () => {
        console.log('Loading cart');

        let method = 'GET';
        let url = 'http://localhost:3001/cart';

        fetch(url, {
            method: method,
            headers: { 'Authorization': 'Bearer ' + this.props.token },
        })
            .then(res => {
                if (res.status !== 200) {
                    throw new Error('Failed to fetch cart.');
                }
                return res.json();
            })
            .then(resData => {
                console.log(resData.products);
                this.setState({
                    products: resData.products,
                });
            })
            .catch(this.catchError);
    };
    showAllProduct = () => {
        if (this.state.products.length > 0) {
            console.log(this.state.products);
            return (
                this.state.products.map(product => {
                    return <p>{product.productId}</p>
                })
            );
        }
    };
    render() {
        return (
            <Fragment>
                <div className="section-top-border">
                    <h3 className="mb-30">Table</h3>
                    <div className="progress-table-wrap">
                        <div className="progress-table">
                            <div className="table-head">
                                <div className="serial">#</div>
                                <div className="country">Countries</div>
                                <div className="visit">Visits</div>
                                <div className="percentage">Percentages</div>
                            </div>
                            <div className="table-row">
                                <div className="serial">01</div>
                                <div className="country"> <img src="assets/img/elements/f1.jpg" alt="flag" />Canada</div>
                                <div className="visit">645032</div>
                                <div className="percentage">
                                    <div className="progress">
                                        <div className="progress-bar color-1" role="progressbar" style={{ width: '80%' }} aria-valuenow={80} aria-valuemin={0} aria-valuemax={100} />
                                    </div>
                                </div>
                            </div>
                            <div className="table-row">
                                <div className="serial">02</div>
                                <div className="country"> <img src="assets/img/elements/f2.jpg" alt="flag" />Canada</div>
                                <div className="visit">645032</div>
